    auto uart = getValue<input_UART>(ctx);
    auto gps = getValue<input_DEV>(ctx);

    uint8_t byte = 0x00;
    unsigned long start = millis();

    do 
    {
      while (uart->available()){
          uart->readByte(&byte);
          gps->encode(byte);
        }
    } while (millis() - start < 1000);

    emitValue<output_DONE>(ctx, 1);
}

